Biology. Adults are almost always attracted to lights or light traps at night. Details of the biology of the Pinhole Borer in WA were given by Clark (1925) , who illustrated the male, female and larva plus the type of wood damage. The relative rarity of adults in collections was explained by the fact that the beetles fly up to the canopy immediately after emerging from the burrow. Clark noted that in WA the hosts of this species included several myrtaceous trees, including Blackbutt (
Eucalyptus patens Benth.
), Tuart (
E. gomphocephala DC.
), Jarrah (
E. marginata Donn ex Sm.
), Wandoo (
Eucalyptus wandoo Blakely
), Flooded Gum (
Eucalyptus rudis Endl.
) and Marri (
Corymbia calophylla (Lindl.) K.D. Hill & L.A.S. Johnson
).
